import React from 'react'


class FormExam extends React.Component {
    render() {
        return (
            <div>
                <main>
                    <h1>II. Exam</h1>
                    <h3>Mood/Behavioral/Psychiatric Assessment</h3>


                </main>
            </div>
        );
    }
}



export default FormExam;
